import React from 'react';
import { DraggableProvider } from './contexts/DraggableContext';
import { Canvas } from './components/Canvas';
import { DraggableItem } from './components/Generals/DraggableItem';

function App() {
  return (
    <DraggableProvider>
      <DraggableItem type="rectangle" />
      <DraggableItem type="circle" />
      <DraggableItem type="vector" />
      <Canvas />
    </DraggableProvider>
  );
}

export default App;
